const initialState = {
    apiData: [],
    providerList: [],
    universitiesList: [],
    subjectList: [],
    childSubjectList: [],
    isLoading: true,
    error: null,
    filteredArray: [],
    totalCourseFound : 0,
    userCoursesFound: 0
};

function CourseListReducer(state = initialState, action) {
    switch (action.type) {
    case ActionTypes.SET_CAR_REG_CONTENT:
        return {
            ...state,
            carContent :  action.payload.data,
        };
    default:
        return state;
    }
}

export default CourseListReducer;
